        [TestMethod]
        public void Test_Load_Find_SLNumber()
        {
            List<Model.LocationService.SiteLocationV2> lstSiteLocationV2 = Model.SerializationUtil.DeserializeFromJson<List<Model.LocationService.SiteLocationV2>>(_strSiteLocationList);

            BLL.SiteLocationAnalyzer objSiteLocationAnalyzer = new BLL.SiteLocationAnalyzer();
            Assert.IsTrue(objSiteLocationAnalyzer.Load(lstSiteLocationV2));

            // Check all the different ways that a "no value" variable might be supplied, to make sure that the matching algorhythm handles that scenario properly

            string strSLNumber = String.Empty;

            // SL Number for these has ONLY a Suite value of 600, meaning that the floor and room and "no value" variables

            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber("", "", "600", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0000093825");

            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber(null, "", "600", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0000093825");


            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber(null, null, "600", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0000093825");

            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber(" ", null, "600", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0000093825");


            // SL0000098554 has a Floor, but no value for Room or Suite
            strSLNumber = String.Empty;
            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber("1", "", "", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0000098554");


            // "SL0002057452" has a room of 9999
            strSLNumber = String.Empty;
            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SLNumber("", "9999", "", out strSLNumber));
            Assert.IsTrue(strSLNumber == "SL0002057452");


            // ??? Can we ignore the other designators

        }



        [TestMethod]
        public void Test_Load_Find_SCode()
        {
            List<Model.LocationService.SiteLocationV2> lstSiteLocationV2 = Model.SerializationUtil.DeserializeFromJson<List<Model.LocationService.SiteLocationV2>>(_strSiteLocationList);

            BLL.SiteLocationAnalyzer objSiteLocationAnalyzer = new BLL.SiteLocationAnalyzer();
            Assert.IsTrue(objSiteLocationAnalyzer.Load(lstSiteLocationV2));

            string strSLNumber = "SL0000093825";
            string strSCode = String.Empty;

            Assert.IsTrue(objSiteLocationAnalyzer.FindServiceLocation_SCode(strSLNumber, out strSCode));
            Assert.IsTrue(strSCode == "S02");

            strSCode = String.Empty;
            Assert.IsFalse(objSiteLocationAnalyzer.FindServiceLocation_SCode("BOGUS", out strSCode));
            Assert.IsTrue(strSCode == String.Empty);


        }

